import React from 'react';
import './App.css';
import Profile from "./components/Profile";
import Dialogs from './components/Dialogs';
import NavBar from "./components/NavBar/Navbar"
import {Route, BrowserRouter, NavLink} from "react-router-dom";

const App = () => {
  return (
      <BrowserRouter>
        <div className="App">
            <NavBar/>
            <Profile name="Daniel"/>
        </div>
      </BrowserRouter>
  );
}

export default App;
